import React from "react";

const TeacherSearchingCard = (props) => {
  return (
    <div>
      <h4>first name: {props.info.firstName}</h4>
      <h4>last name: {props.info.lastName}</h4>
      <h4>email name: {props.info.email}</h4>
      <h4>specialization : {props.info.specialization}</h4>
      <br></br>
    </div>
  );
};

export default TeacherSearchingCard;
